-------------------------------------------------------------------------
-- SERVICES & SETUP
-------------------------------------------------------------------------
local Players = game:GetService("Players")
local RunService = game:GetService("RunService")
local UserInputService = game:GetService("UserInputService")
local HttpService = game:GetService("HttpService")

local player = Players.LocalPlayer
local character = player.Character or player.CharacterAdded:Wait()
local humanoid = character:WaitForChild("Humanoid")
local rootPart = character:WaitForChild("HumanoidRootPart")

local checkpoints = {}
local isRunning = true
local currentCheckpoint = 1
local isAutoRespawn = true
local isLooping = true

print("[AUTOWALK] Player Script Started")

-------------------------------------------------------------------------
-- STATUS UPDATE (Simple Print)
-------------------------------------------------------------------------
local function updateStatus(text)
    print("[AUTOWALK] " .. text)
end

-------------------------------------------------------------------------
-- STOP KEY (F5)
-------------------------------------------------------------------------
UserInputService.InputBegan:Connect(function(input, gameProcessed)
    if not gameProcessed and input.KeyCode == Enum.KeyCode.F5 then
        isRunning = false
        updateStatus("Stopped by user (F5)")
    end
end)

-------------------------------------------------------------------------
-- RESPAWN HANDLER
-------------------------------------------------------------------------
player.CharacterAdded:Connect(function(newChar)
    task.wait(0.5)
    character = newChar
    humanoid = newChar:WaitForChild("Humanoid")
    rootPart = newChar:WaitForChild("HumanoidRootPart")
    
    if isRunning and #checkpoints > 0 then
        updateStatus("Respawned! Continuing...")
        task.wait(1)
        playAllCheckpoints()
    end
end)

-------------------------------------------------------------------------
-- PRESS NUMBER 1 KEY (NOT NUMPAD)
-------------------------------------------------------------------------
local function pressKey1()
    updateStatus("Activating item (pressing 1)...")
    
    local vim = game:GetService("VirtualInputManager")
    
    -- Press number 1 (KeyCode.One, not numpad)
    vim:SendKeyEvent(true, Enum.KeyCode.One, false, game)
    task.wait(0.1)
    vim:SendKeyEvent(false, Enum.KeyCode.One, false, game)
    
    task.wait(0.5) -- Wait for activation
    updateStatus("Item activated!")
end

-------------------------------------------------------------------------
-- FIND NEAREST CHECKPOINT
-------------------------------------------------------------------------
local function findNearestCheckpoint()
    if #checkpoints == 0 then return 1 end
    
    local playerPos = rootPart.Position
    local nearestIndex = 1
    local nearestDistance = math.huge
    
    for i, cp in ipairs(checkpoints) do
        if cp.startPos then
            local cpPos = cp.startPos
            local distance = (playerPos - cpPos).Magnitude
            
            if distance < nearestDistance then
                nearestDistance = distance
                nearestIndex = i
            end
        end
    end
    
    updateStatus("Nearest checkpoint: " .. checkpoints[nearestIndex].name .. " (Distance: " .. math.floor(nearestDistance) .. " studs)")
    return nearestIndex
end

-------------------------------------------------------------------------
-- PLAYBACK FUNCTION
-------------------------------------------------------------------------
local function playCheckpoint(index)
    if not isRunning or index > #checkpoints then return end
    
    local cp = checkpoints[index]
    currentCheckpoint = index
    
    updateStatus("Playing: " .. cp.name)
    
    -- Set movement mode to scriptable
    player.DevComputerMovementMode = Enum.DevComputerMovementMode.Scriptable
    player.DevTouchMovementMode = Enum.DevTouchMovementMode.Scriptable
    
    -- Teleport to start position
    if cp.startPos then
        rootPart.CFrame = CFrame.new(cp.startPos) * rootPart.CFrame.Rotation
        task.wait(0.1)
    end
    
    -- Play all inputs
    for i, inp in ipairs(cp.inputs) do
        if not isRunning then break end
        
        -- STABILIZATION: Correct position drift
        if inp.p then
            local currentPos = rootPart.Position
            local expectedPos = inp.p
            local dist = (currentPos - expectedPos).Magnitude
            
            if dist > 3.0 then
                rootPart.CFrame = CFrame.new(expectedPos) * rootPart.CFrame.Rotation
            elseif dist > 0.5 then
                rootPart.CFrame = CFrame.new(expectedPos) * rootPart.CFrame.Rotation
            end
        end
        
        -- INTERACTION REPLAY
        if inp.interaction then
            updateStatus("Interacting with: " .. (inp.interaction.targetName or "Unknown"))
            local targetObj = nil
            
            -- Search for world objects (ClickDetector, ProximityPrompt)
            pcall(function()
                local r = 20
                local region = Region3.new(rootPart.Position - Vector3.new(r,r,r), rootPart.Position + Vector3.new(r,r,r))
                local parts = workspace:FindPartsInRegion3(region, nil, 100)
                
                for _, part in ipairs(parts) do
                    if part.Name == inp.interaction.targetName then
                        if inp.interaction.type == "ClickDetector" then
                            targetObj = part:FindFirstChild("ClickDetector") or part.Parent:FindFirstChild("ClickDetector")
                            if targetObj then break end
                        elseif inp.interaction.type == "ProximityPrompt" then
                            targetObj = part:FindFirstChild("ProximityPrompt") or part.Parent:FindFirstChild("ProximityPrompt")
                            if targetObj then break end
                        end
                    end
                end
            end)
            
            if targetObj then
                if inp.interaction.type == "ClickDetector" and fireclickdetector then
                    fireclickdetector(targetObj)
                elseif inp.interaction.type == "ProximityPrompt" and fireproximityprompt then
                    fireproximityprompt(targetObj)
                end
                task.wait(0.5)
            else
                -- UI Button Interaction
                if inp.interaction.type == "GuiButton" then
                    local pGui = player:WaitForChild("PlayerGui")
                    local targetButton = nil
                    
                    -- Search for button by name
                    for _, child in ipairs(pGui:GetDescendants()) do
                        if child.Name == inp.interaction.targetName and (child:IsA("TextButton") or child:IsA("ImageButton")) then
                            targetButton = child
                            break
                        end
                    end
                    
                    if targetButton then
                        updateStatus("Clicking Button: " .. targetButton.Name)
                        
                        -- Try firesignal
                        local fired = false
                        if firesignal then
                            pcall(function()
                                firesignal(targetButton.MouseButton1Click)
                                fired = true
                            end)
                        end
                        
                        -- Try getconnections
                        if not fired and getconnections then
                            pcall(function()
                                for _, conn in ipairs(getconnections(targetButton.MouseButton1Click)) do
                                    conn:Fire()
                                    fired = true
                                end
                            end)
                        end
                        
                        task.wait(0.5)
                    end
                end
            end
        end
        
        -- MOVEMENT
        local startTime = tick()
        local duration = inp.dt
        
        humanoid.Jump = inp.j
        
        while (tick() - startTime) < duration do
            if not isRunning then break end
            
            humanoid:Move(inp.d)
            
            if inp.j then humanoid.Jump = true end
            
            RunService.Stepped:Wait()
        end
    end
    
    -- Stop movement
    humanoid:Move(Vector3.zero)
    humanoid.Jump = false
    
    updateStatus("Finished: " .. cp.name)
end

-------------------------------------------------------------------------
-- PLAY ALL CHECKPOINTS (LOOP)
-------------------------------------------------------------------------
function playAllCheckpoints()
    -- Press number 1 to activate item (Initial Start)
    pressKey1()
    
    -- Start from nearest checkpoint
    local startIndex = findNearestCheckpoint()
    
    while isRunning do
        for i = startIndex, #checkpoints do
            if not isRunning then break end
            playCheckpoint(i)
            task.wait(0.5)
        end
        
        -- After first loop, check if we should continue
        if isRunning then
            if isAutoRespawn then
                updateStatus("Auto Respawning...")
                local char = player.Character
                if char then
                    local hum = char:FindFirstChild("Humanoid")
                    if hum then hum.Health = 0 end
                end
                
                if isLooping then
                    updateStatus("Waiting for Respawn (Looping)...")
                    local newChar = player.CharacterAdded:Wait()
                    task.wait(3)
                    
                    character = newChar
                    humanoid = newChar:WaitForChild("Humanoid")
                    rootPart = newChar:WaitForChild("HumanoidRootPart")
                    
                    -- Press number 1 ONLY after respawn
                    pressKey1()
                    
                    updateStatus("Restarting Loop...")
                    startIndex = 1
                else
                    break
                end
            elseif isLooping then
                updateStatus("Loop complete! Restarting...")
                task.wait(1)
                startIndex = 1
            else
                break
            end
        end
    end
    
    updateStatus("Playback Complete!")
end

-------------------------------------------------------------------------
-- DESERIALIZE DATA
-------------------------------------------------------------------------
local function deserialize(jsonStr)
    local success, data = pcall(function()
        return HttpService:JSONDecode(jsonStr)
    end)
    
    if not success then
        updateStatus("Error parsing JSON!")
        return nil
    end
    
    local loaded = {}
    for _, cpData in ipairs(data) do
        local newCP = {
            name = cpData.name,
            startPos = cpData.startPos and Vector3.new(cpData.startPos[1], cpData.startPos[2], cpData.startPos[3]) or nil,
            inputs = {}
        }
        
        for _, inpData in ipairs(cpData.inputs) do
            local dVec = inpData.d and Vector3.new(inpData.d[1], inpData.d[2], inpData.d[3]) or Vector3.zero
            local pVec = inpData.p and Vector3.new(inpData.p[1], inpData.p[2], inpData.p[3]) or nil
            
            table.insert(newCP.inputs, {
                dt = inpData.dt,
                d = dVec,
                j = inpData.j,
                p = pVec,
                interaction = inpData.i
            })
        end
        table.insert(loaded, newCP)
    end
    return loaded
end

-------------------------------------------------------------------------
-- MAIN START
-------------------------------------------------------------------------
if RECORDING_DATA and RECORDING_DATA ~= "" and RECORDING_DATA:find("%[") then
    updateStatus("Loading data...")
    local data = deserialize(RECORDING_DATA)
    if data then
        checkpoints = data
        updateStatus("Data Loaded! Found " .. #checkpoints .. " checkpoints")
        updateStatus("Starting in 3s...")
        task.wait(3)
        playAllCheckpoints()
    else
        updateStatus("Error: Invalid Data.")
    end
else
    updateStatus("Error: No recording data found. Please paste your JSON data in RECORDING_DATA variable.")
end
